import react from "react";
import './TicTacToe.css';

const board = [
    <div class="board">
            <div class="cell"><span>x</span></div>
            <div class="cell"><span></span></div>
            <div class="cell"><span></span></div>
        </div>
];

const TicTacToe = () => {
    return <div className="tic-tac-toe">
        <h1>TicTacToe</h1>
    </div>
}

export default TicTacToe;
